        public static Tuple<int, string> LengthOfLongestSubstrings(string s)
        {
            System.Timers.Timer timer = new System.Timers.Timer();
            timer.Start();

            int n = s.Length;
            int ans = 0;

            string builder = string.Empty;

            for (int i = 0; i < n; i++)
            {
                if (!builder.Contains(s[i]))
                {
                    builder += s[i];

                    ans = Math.Max(ans, builder.Length);
                }
                else
                {
                    ans = Math.Max(ans, builder.Length);

                    builder += s[i];

                    builder = builder.Substring(builder.IndexOf(s[i]) + 1 );
                }

            }

            timer.Stop();
            var t = timer.Interval.ToString();
            return new Tuple<int, string>(ans, t);
        }


        public static int LengthOfLongestSubstring_122ms(string s)
        {
            if (string.IsNullOrEmpty(s))
            {
                return 0;
            }
            int result = 1;
            int[] freq = new int[256];
            int i = 0;
            int j = 0;
            while (i < s.Length)
            {
                char c = s[i];
                if (freq[c] == 0)
                {
                    freq[c] = 1;
                    i++;
                }
                else
                {
                    result = Math.Max(i - j, result);
                    while (s[j] != c)
                    {
                        freq[s[j]]--;
                        j++;
                    }
                    i++;
                    j++;
                }
            }
            result = Math.Max(i - j, result);
            return result;
        }



        public static Tuple<int, string> LengthOfLongestSubstring(string s)
        {
            System.Timers.Timer timer = new System.Timers.Timer();
            timer.Start();

            int n = s.Length;
            int ans = 0;

            for (int i = 0; i < n; i++)
            {
                List<object> list = new List<object>();

                list.Add(s[i]);

                for (int j = i + 1; j < n; j++)
                {
                    if (list.Contains(s[j]))
                    {
                        ans = Math.Max(ans, list.Count);
                        break;
                    }
                    else
                    {
                        list.Add(s[j]);
                    }
                }

                ans = Math.Max(ans, list.Count);
            }

            timer.Stop();

            return new Tuple<int, string>(ans, timer.Interval.ToString());
        }

        public static bool allUnique(String s, int start, int end)
        {
            List<object> list = new List<object>();
            for (int i = start; i < end; i++)
            {
                object ch = s.Substring(i, 1);
                if (list.Contains(ch))
                {
                    return false;
                }
                list.Add(ch);
            }
            return true;
        }
